import React from 'react';
import * as AiIcons from 'react-icons/ai';

export const SidebarData = [
  {
    title: 'Home',
    path: '/home',
    icon: <AiIcons.AiFillHome />,
    cName: 'nav-text'
  },
  {
    title: 'Tour',
    path: '/tours',
    icon: <AiIcons.AiOutlineCompass />,
    cName: 'nav-text'
  },
  {
    title: 'Profile',
    path: '/profile',
    icon: <AiIcons.AiOutlineUser />,
    cName: 'nav-text'
  }
];
